INSERT INTO `core_privacy_policy` (`id`, `content`) VALUES
('privacy1', '&lt;p&gt;&lt;strong&gt;Privacy Policy&lt;/strong&gt;&lt;br /&gt;\r\nPanacea-Soft built the Flutter Grocery app as a Free app. This SERVICE is provided by Panacea-Soft at no cost and is intended for use as is.&lt;/p&gt;\r\n\r\n&lt;p&gt;This page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which is accessible at Flutter Grocery unless otherwise defined in this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;Information Collection and Use&lt;/p&gt;\r\n\r\n&lt;p&gt;For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to Flutter Grocery. The information that we request will be retained by us and used as described in this privacy policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;The app does use third party services that may collect information used to identify you.&lt;/p&gt;\r\n\r\n&lt;p&gt;Link to privacy policy of third party service providers used by the app&lt;/p&gt;\r\n\r\n&lt;p&gt;Google Play Services&lt;br /&gt;\r\nAdMob&lt;br /&gt;\r\nGoogle Analytics for Firebase&lt;br /&gt;\r\nFirebase Crashlytics&lt;br /&gt;\r\nFacebook&lt;br /&gt;\r\nLog Data&lt;/p&gt;\r\n\r\n&lt;p&gt;We want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (&amp;ldquo;IP&amp;rdquo;) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.&lt;/p&gt;\r\n\r\n&lt;p&gt;Cookies&lt;/p&gt;\r\n\r\n&lt;p&gt;Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device&amp;#39;s internal memory.&lt;/p&gt;\r\n\r\n&lt;p&gt;This Service does not use these &amp;ldquo;cookies&amp;rdquo; explicitly. However, the app may use third party code and libraries that use &amp;ldquo;cookies&amp;rdquo; to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;Service Providers&lt;/p&gt;\r\n\r\n&lt;p&gt;We may employ third-party companies and individuals due to the following reasons:&lt;/p&gt;\r\n\r\n&lt;p&gt;To facilitate our Service;&lt;br /&gt;\r\nTo provide the Service on our behalf;&lt;br /&gt;\r\nTo perform Service-related services; or&lt;br /&gt;\r\nTo assist us in analyzing how our Service is used.&lt;br /&gt;\r\nWe want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.&lt;/p&gt;\r\n\r\n&lt;p&gt;Security&lt;/p&gt;\r\n\r\n&lt;p&gt;We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.&lt;/p&gt;\r\n\r\n&lt;p&gt;Links to Other Sites&lt;/p&gt;\r\n\r\n&lt;p&gt;This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.&lt;/p&gt;\r\n\r\n&lt;p&gt;Children&amp;rsquo;s Privacy&lt;/p&gt;\r\n\r\n&lt;p&gt;These Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.&lt;/p&gt;\r\n\r\n&lt;p&gt;Changes to This Privacy Policy&lt;/p&gt;\r\n\r\n&lt;p&gt;We may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page.&lt;/p&gt;\r\n\r\n&lt;p&gt;This policy is effective as of 2020-12-22&lt;/p&gt;\r\n\r\n&lt;p&gt;Contact Us&lt;/p&gt;\r\n\r\n&lt;p&gt;If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us at teamps.is.cool@gmail.com.&lt;/p&gt;\r\n\r\n&lt;p&gt;This privacy policy page was created at privacypolicytemplate.net and modified/generated by App Privacy Policy Generator&lt;/p&gt;');
